import React from "react";

export default function Card(props) {
  const { title, description, link } = props;
  props = {
    title: "Title",
    description:
      "MyMedicalLocker is a secure patient portal that allows patients to access their medical records 24/7. ",
    link: "./",
  };
  return (
    <div>
      <h3>{title}</h3>
      <p>{description}</p>
      <a>View Project</a>
    </div>
  );
}
